 import React from "react";
 
 class Userclass extends React.Component {

    constructor (props){
        super(props);
    }

    render() {
        return (
            <div className="users">
             <h2>Name: {this.props.name} </h2>
             <h3>Location: {this.props.location} </h3>
             <h3>Social Media: @avanti2710</h3>
     
            </div> 
            
         )
    }
 }

 export default Userclass;
